import React, { useState } from "react";
import Button from 'react-bootstrap/Button';


const btn = () => {
    let [value, setValue] = useState(0);

    const increment = () => {
      setValue(value + 1);
    };
  
    const decrement = () => {
      setValue(value - 1);
    };

return (
        <div>
             <h3>conunter value is {value} </h3>
              <Button variant="primary" onClick={incremement}>incremement</Button>
              <Button variant="secondary" onClick={decrememet}>decrememet</Button>
        </div>
    );
};

export default btn
